import React from 'react';

class LateralMenu extends React.Component{
	render(){
		return(
			<div>
				<ul>
					<li>Companies</li>
					<li>Usuários</li>
					<li>Resetar Senha</li>
					<li>Simulação</li>
				</ul>
			</div>
		);
	}
}

export default LateralMenu;
